import React,{ Component ,useHistory} from 'react';
import logo from '../Ressources/WB.png'


class Navbar extends Component{

    constructor(props) {
        super(props);
        // N’appelez pas `this.setState()` ici !
        this.state = { history : useHistory() };
        this.handleClick = this.handleClick.bind(this);
      }

    componentDidMount(){
        document.addEventListener('DOMContentLoaded', function() {
            var M=window.M
            var elems = document.querySelectorAll('.sidenav');
            M.Sidenav.init(elems, {});
          });
    }

    render() {
        return (
            <div>
                <div className="navbar-fixed">
                <nav>
                    <div className="nav-wrapper teal lighten-2">
                    <img onClick={()=> {history.push("/");}} className="brand-logo center" src={logo} style={{width:`60px` , height: `100%`}} alt="logo" />
                    <a href="/" data-target="mobile-demo" className="sidenav-trigger"><i className="material-icons">menu</i></a>
                    <ul className="right hide-on-med-and-down">
                        <li><a href="/Projects">Projects</a></li>
                        <li><a href="/Resume">Resume</a></li>
                    </ul>
                    </div>
                </nav>
                </div>
                <ul className="sidenav" id="mobile-demo">
                    <li><a href="/">Walid BOUKRIS</a></li>
                    <li><a href="/Projects">Projects</a></li>
                    <li><a href="/Resume">Resume</a></li>
                </ul>

            </div>


        );
    }
}        
export default Navbar;        

